    def sieve():
        for i in range(2, 10 ** 5 + 1):
            if store[i] == 0:
                store[i] = 1
                for j in range(i, 10 ** 5 + 1, i):
                    store[j] = i
    sieve()
    results = []
    for test_case in test_cases:
        (N, sequence) = test_case
        dp = [0] * (10 ** 5 + 1)
        for num in sequence:
            dp[store[num]] += 1
        max_re = 0
        res = 0
        for num in sequence:
            if dp[store[num]] == max_re:
                if store[num] > res:
                    res = store[num]
            elif dp[store[num]] > max_re:
                max_re = dp[store[num]]
                res = store[num]
        results.append(res)
    return results

